import React, { Component } from 'react';

const TITLES = [
    'a software engineer',
    'a music lover',
    ' a football lover',
    'an enthusiastic learner',
    'an adventure seeker'
]

class Title extends Component{
    state = {titleIndex: 0}

    render(){
const title =TITLES[this.state.titleIndex]
        returna(<p>I'm {title} </p>)
    }
}

export default Title
